import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { Card, CardContent, Button, Link } from "@mui/material";
import DownloadOutlined from "@mui/icons-material/DownloadOutlined";
import NetworkCheckIcon from '@mui/icons-material/NetworkCheck'; // Network stat icon

const Square = () => {
    return (
        <Button
            component="a"
            href="/path-to-your-whitepaper.pdf"
            target="_blank"
            download
            sx={{ color: "white", bgcolor: "#6d8d6e", mt: 3, px: 3 }}
        >
            Download Whitepaper
        </Button>
    );
};

const NetworkActivitySection = () => {
    return (
        <Box sx={{ py: 7, bgcolor: "white" }} id="networkactivitysection">
            <Grid container spacing={4} sx={{ width: "100%", mx: 0 }}>
                {/* Left Side: Network Stats */}
                <Grid item xs={12} md={6} sx={{ px: 3 }}>
                    <Card sx={{ minWidth: 275, maxWidth: 600, mx: "auto", bgcolor: "#f5f5f5", color: "#363636", py: 3 }}>
                        <CardContent sx={{ textAlign: "center" }}>
                            {/* Network Activity Header */}
                            <Typography variant="h4" sx={{ fontWeight: "bold", mb: 3 }}>
                                Network Activity
                            </Typography>

                            {/* Network Stat Icon */}
                            <Box sx={{ display: "flex", justifyContent: "center", mb: 2 }}>
                                <NetworkCheckIcon sx={{ fontSize: 80, color: "#6d8d6e" }} />
                            </Box>

                            <Typography variant="body1" color="textSecondary">
                                Monitor the real-time activity on the Alkebuleum blockchain. Stay updated on the latest network status, block information, and more.
                            </Typography>

                            <Box sx={{ mt: 3 }}>
                                <Button
                                    component="a"
                                    href="https://your-block-explorer-url" // Replace with actual block explorer URL
                                    target="_blank"
                                    sx={{ color: "white", bgcolor: "#6d8d6e", mt: 3, px: 3 }}
                                >
                                    View Block Explorer
                                </Button>
                            </Box>
                        </CardContent>
                    </Card>
                </Grid>

                {/* Right Side: Whitepaper Download */}
                <Grid item xs={12} md={6} sx={{ px: 3 }}>
                    <Card sx={{ minWidth: 275, maxWidth: 600, mx: "auto", bgcolor: "#f5f5f5", color: "#363636", py: 3 }}>
                        <CardContent sx={{ textAlign: "center" }}>
                            {/* Download Whitepaper Header */}
                            <Typography variant="h4" sx={{ fontWeight: "bold", mb: 3 }}>
                                Download Whitepaper
                            </Typography>

                            {/* Download Icon */}
                            <Box sx={{ display: "flex", justifyContent: "center", mb: 2 }}>
                                <DownloadOutlined sx={{ fontSize: 80, color: "#6d8d6e" }} />
                            </Box>

                            <Typography variant="body1" color="textSecondary">
                                Discover how Alkebuleum is reshaping blockchain technology by addressing real-world challenges. Learn about its vision, technology, and economic impact by downloading our whitepaper.
                            </Typography>

                            <Box sx={{ mt: 3 }}>
                                <Square />
                            </Box>
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
        </Box>
    );
};

export default NetworkActivitySection;
